import styled from "styled-components";

function App() {
  return (
    <div className="App">
      <h1>Tic Tac Toe</h1>
      <Container>
        <Tr>
          <td>1</td>
          <td>2</td>
          <td>3</td>
        </Tr>
        <Tr>
          <td>4</td>
          <td>5</td>
          <td>6</td>
        </Tr>
        <Tr>
          <td>7</td>
          <td>8</td>
          <td>9</td>
        </Tr>
      </Container>
    </div>
  );
}

const Container = styled.table`
  width: 100px;
  height: 100px;
  border: 1px solid #000000;
`;

const Tr = styled.tr`
  border: 1px solid #000000;
`;


export default App;
